DROP TABLE MOVIEACTOR
DROP TABLE Transactions
DROP TABLE InvItems
DROP TABLE Review
DROP TABLE Director
DROP TABLE Author
DROP TABLE EVENT_S
DROP TABLE BORROWER
DROP TABLE INVENTORY
DROP TABLE Actor
DROP TABLE Movie
DROP TABLE Book
DROP TABLE LIBRARY_B





CREATE TABLE [dbo].[Library_B] (
    [LID]             INT           NOT NULL,
    [LName]           NVARCHAR (50) NOT NULL,
    [LibraryLocation] NVARCHAR (50) NOT NULL,
    [PhoneNumber]     NVARCHAR (50) NULL,
    PRIMARY KEY CLUSTERED ([LID] ASC)
);


CREATE TABLE [dbo].[Book] (
    [BookID]        INT            NOT NULL,
    [BookName]      NVARCHAR (50)  NOT NULL,
    [Genre]         NVARCHAR (50)  NOT NULL,
    [Edition]       NUMERIC (18)   NULL,
    [DatePublished] DATE           NOT NULL,
    [Synopsis]      NVARCHAR (MAX) NULL,
    PRIMARY KEY CLUSTERED ([BookID] ASC)
);

CREATE TABLE [dbo].[Movie] (
    [MID]          INT            NOT NULL,
    [Synopsis]     NVARCHAR (MAX) NULL,
    [DateReleased] DATE           NOT NULL,
    [Edition]      NCHAR (10)     NULL,
    [MovieName]    NVARCHAR (50)  NOT NULL,
    [Genre]        NVARCHAR (50)  NOT NULL,
    PRIMARY KEY CLUSTERED ([MID] ASC)
);



CREATE TABLE [dbo].[Actor] (
    [ActorID] INT            NOT NULL,
    [First]   NVARCHAR (50)  NOT NULL,
    [Middle]  NVARCHAR (50)  NULL,
    [Last]    NVARCHAR (50)  NOT NULL,
    [BIO]     NVARCHAR (MAX) NULL,
    [DOB]     DATE           NOT NULL,
    PRIMARY KEY CLUSTERED ([ActorID] ASC)
);

CREATE TABLE [dbo].[Inventory] (
    [InventoryID] INT NOT NULL,
    [LID]         INT NOT NULL,
    PRIMARY KEY CLUSTERED ([InventoryID] ASC),
    CONSTRAINT [LibraryFK3] FOREIGN KEY ([LID]) REFERENCES [dbo].[Library_B] ([LID])
);

CREATE TABLE [dbo].[Borrower] (
    [BID]   INT           NOT NULL,
    [Fname] NVARCHAR (50) NOT NULL,
    [Lname] NVARCHAR (50) NOT NULL,
    [DOB]   DATE          NOT NULL,
    [LID]   INT           NOT NULL,
    PRIMARY KEY CLUSTERED ([BID] ASC),
    CONSTRAINT [LibraryFK2] FOREIGN KEY ([LID]) REFERENCES [dbo].[Library_B] ([LID])
);

CREATE TABLE [dbo].[Event_S] (
    [EID]         INT            NOT NULL,
    [Date_Time]   DATETIME       NOT NULL,
    [Description] NVARCHAR (MAX) NOT NULL,
    [LibID]       INT            NOT NULL,
    PRIMARY KEY CLUSTERED ([EID] ASC),
    CONSTRAINT [LibraryFK] FOREIGN KEY ([LibID]) REFERENCES [dbo].[Library_B] ([LID])
);


CREATE TABLE [dbo].[Author] (
    [AID]    INT            NOT NULL,
    [FName]  NVARCHAR (50)  NOT NULL,
    [MName]  NVARCHAR (50)  NULL,
    [LName]  NVARCHAR (50)  NOT NULL,
    [Bio]    NVARCHAR (MAX) NULL,
    [DOB]    DATE           NOT NULL,
    [BookID] INT            NOT NULL,
    PRIMARY KEY CLUSTERED ([AID] ASC),
    CONSTRAINT [BookFK2] FOREIGN KEY ([BookID]) REFERENCES [dbo].[Book] ([BookID])
);

CREATE TABLE [dbo].[Director] (
    [DID]   INT            NOT NULL,
    [FName] NVARCHAR (50)  NOT NULL,
    [LNAme] NVARCHAR (50)  NOT NULL,
    [Bio]   NVARCHAR (MAX) NULL,
    [Dob]   DATE           NOT NULL,
    [MID]   INT            NOT NULL,
    PRIMARY KEY CLUSTERED ([DID] ASC),
    CONSTRAINT [MovieFK2] FOREIGN KEY ([MID]) REFERENCES [dbo].[Movie] ([MID])
);


CREATE TABLE [dbo].[Review] (
    [RID]     INT            NOT NULL,
    [Type77]    INT            NOT NULL,
    [ItemID]  INT            NOT NULL,
    [Date]    DATE           NOT NULL,
    [Content] NVARCHAR (MAX) NOT NULL,
    [BID]     INT            NULL,
	[Rating]  INT            NULL,
    PRIMARY KEY CLUSTERED ([RID] ASC),
    CONSTRAINT [BookFK] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Book] ([BookID]),
    CONSTRAINT [BorrowerFK] FOREIGN KEY ([BID]) REFERENCES [dbo].[Borrower] ([BID]),
    CONSTRAINT [MovieFK] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Movie] ([MID]),
    CONSTRAINT [Type77C] CHECK (Type77 >= 0 AND Type77 <= 1),
	CONSTRAINT [Type77R] CHECK (Rating >=0 AND Rating <= 10)

);




CREATE TABLE [dbo].[InvItems] (
    [InventoryID] INT NOT NULL,
    [LID]         INT NOT NULL,
    [ItemID]      INT NOT NULL,
	[Type77]        INT NOT NULL,
    [NumCopies]   INT NOT NULL,
    PRIMARY KEY CLUSTERED ([InventoryID] ASC, [LID] ASC, [ItemID] ASC),
    CONSTRAINT [Inventory1] FOREIGN KEY ([InventoryID]) REFERENCES [dbo].[Inventory] ([InventoryID]),
    CONSTRAINT [Library_BFK5] FOREIGN KEY ([LID]) REFERENCES [dbo].[Library_B] ([LID]),
    CONSTRAINT [BookFK6] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Movie] ([MID]),
    CONSTRAINT [BookFK5] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Book] ([BookID]),
    CONSTRAINT [Type77B] CHECK ([Type77]>=(0) AND [Type77]<=(1))
);




CREATE TABLE [dbo].[Transactions] (
    [TID]    INT  NOT NULL,
    [Type77]   INT  NOT NULL,
    [ItemID] INT  NOT NULL,
    [CDate]  DATE NOT NULL,
    [DDate]  DATE NOT NULL,
    [BID]    INT  NULL,
    PRIMARY KEY CLUSTERED ([TID] ASC),
    CONSTRAINT [BorrowerFK1] FOREIGN KEY ([BID]) REFERENCES [dbo].[Borrower] ([BID]),
    CONSTRAINT [BookFK3] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Movie] ([MID]),
    CONSTRAINT [BookFK4] FOREIGN KEY ([ItemID]) REFERENCES [dbo].[Book] ([BookID]),
    CONSTRAINT [Type77A] CHECK (Type77 >= 0 AND Type77 <= 1)
);

CREATE TABLE [dbo].[MovieActor] (
    [ActorID] INT NOT NULL,
    [MID]     INT NOT NULL,
    CONSTRAINT [MovieFK3] FOREIGN KEY ([MID]) REFERENCES [dbo].[Movie] ([MID]),
    CONSTRAINT [ActorFK] FOREIGN KEY ([ActorID]) REFERENCES [dbo].[Actor] ([ActorID])
);






